filter_layout_id.script:
return playlists
  .filter(p => {
    if (!p.meta) {
      return false;
    }

    if (!options || !options.ids || !Array.isArray(options.ids)) {
      return false;
    }

    const meta =
      typeof p.meta === 'string'
        ? JSON.parse(p.meta)
        : p.meta;

    if (!meta.layoutId) {
      return false;
    }

    return options.ids.includes(meta.layoutId);
  });

filter_time.script:
return playlists
  .filter(p => {
    if (!p.meta) {
      return false;
    }

    const meta =
      typeof p.meta === 'string'
        ? JSON.parse(p.meta)
        : p.meta;

    if (!meta.lengthType) {
      return false;
    }

    if (!options || !options.minutes) {
      return false;
    }

    return meta.lengthType === options.minutes;
  });
